import { useState } from "react";

function MobileNav() {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div className="flex items-center justify-between">
      <div className="text-2xl font-semibold">John Doe</div>
      <div className="relative">
        <button
          aria-label="Toggle menu"
          onClick={() => setMenuOpen((s) => !s)}
          className="flex flex-col justify-between h-6 w-8"
        >
          <span
            className={`block h-[2px] bg-black transition-transform ${
              menuOpen ? "translate-y-[6px] rotate-45" : ""
            }`}
          />
          <span
            className={`block h-[2px] bg-black transition-opacity ${
              menuOpen ? "opacity-0" : "opacity-100"
            }`}
          />
          <span
            className={`block h-[2px] bg-black transition-transform ${
              menuOpen ? "translate-y-[-6px] -rotate-45" : ""
            }`}
          />
        </button>

        <div
          className={`absolute right-0 mt-2 bg-white shadow-md rounded-md overflow-hidden transition-max-h duration-300 ${
            menuOpen ? "max-h-64" : "max-h-0"
          }`}
        >
          <ul className="flex flex-col text-lg">
            <li>
              <a
                className="block px-6 py-3"
                href="#about"
                onClick={() => setMenuOpen(false)}
              >
                About
              </a>
            </li>
            <li>
              <a
                className="block px-6 py-3"
                href="#experience"
                onClick={() => setMenuOpen(false)}
              >
                Experience
              </a>
            </li>
            <li>
              <a
                className="block px-6 py-3"
                href="#projects"
                onClick={() => setMenuOpen(false)}
              >
                Projects
              </a>
            </li>
            <li>
              <a
                className="block px-6 py-3"
                href="#contact"
                onClick={() => setMenuOpen(false)}
              >
                Contact
              </a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default MobileNav;
